query Floorplans($modelId: ID!) {
  model(id: $modelId) {
    id
    assets {
      floorplans(provider: "Matterport") {
        id
        status
        url
        validUntil
        filename
        format
        height
        width
        resolution
        origin {
          x
          y
        }
        floor {
          id
        }
        flags
        provider
      }
    }
  }
}
